

SELECT 
	distinct
		value
		,ROWS
	FROM sys.partitions p JOIN sys.indexes i
		  ON p.object_id = i.object_id and p.index_id = i.index_id
		   JOIN sys.partition_schemes ps
					ON ps.data_space_id = i.data_space_id
		   JOIN sys.partition_functions f
					   ON f.function_id = ps.function_id
		   LEFT JOIN sys.partition_range_values rv
	ON f.function_id = rv.function_id AND p.partition_number = rv.boundary_id
	WHERE OBJECT_NAME(i.object_id) = 'TrackedExposure_SUSPECT'
	AND ROWS > 0
	order by value	
	
	
SELECT NSEID,p.PublisherName, ClientID,CAST(CreateDate AS DATE) AS CDate,COUNT(1)
FROM dbo.TrackedExposure_SUSPECT tem --WITH (INDEX(NDX_TrackedExposureMaster1__TrackingSourceID_ClientID_UserUniqueGUID))
LEFT JOIN SIProcessing..LUPublisher p ON p.LegacySearchEngineID = tem.NSEID
WHERE SuspectMessage = '- PublisherID IS NULL -'
GROUP BY NSEID, ClientID,p.PublisherName,CAST(CreateDate AS DATE)
ORDER BY NSEID,CAST(CreateDate AS DATE)

