DECLARE @start DATE = '06/09/2012',
	@End DATE = '07/12/2012'

WHILE (@start < @End)
BEGIN

	INSERT INTO  JunkDB..TrackedExposure_SUSPECT07112012( EasternCreateDate, KeywordID, ClientID, NSEID, URL, IPAddress, OSVersion, BrowserVersion, ReferralURL, ReferralPage, IsPaidInclusion, ProductText, Keyword, UserUniqueGuid, ReferenceID ,CreateDate, WebServerName,QueriedPage,Domain,ExceptionID,GlobalTrackingTypeID, GlobalTrackingID, AttributeCollection)
